import ListBooks from "./ListBooks";
import EmptyBooks from "./EmptyBooks";

const BookList = ({
                      shelves, books,
                      getBooks,
                      isLoading
                  }) => {
    return (
        <div className="list-books">
            <div className="list-books-title">
                <h1>MyReads</h1>
            </div>
            {books.length > 0
                ? <ListBooks
                    shelves={shelves}
                    books={books}
                    getBooks={getBooks}
                    isLoading={isLoading}
                />
                : <EmptyBooks/>
            }
        </div>
    )
};

export default BookList;
